import React, { Component } from 'react';



export default class LayoutTemplateBanner extends Component {

    constructor(props) {
        super(props);
        this.state = {
            misPhotos: [{ number: "1" }, { number: "2" }, { number: "3"}]
        }
        this.photos = this.photos.bind(this);
    }

    photos() {
        let misPhotos = this.state;
        console.log(misPhotos);
        return (<div id="home-slider" class="home-slider">{misPhotos.map((n) => {<div class="item">{n}</div>})}</div>)
    }

    render() {

        return (
            <div class="banner haslayout">
                <div class="slider-caption">
                    <div class="box">
                        <div class="holder">
                            <div class="frame">
                                <div class="border-center">
                                    <span class="title">Great Features</span>
                                </div>
                                <div class="border-center">
                                    <h1>Our Designer <span>dresses</span></h1>
                                </div>
                                <div class="description">
                                    <p>Claritas est etiam processus dynamicus, qui sequitur mutationem consuetudium lectorum.</p>
                                </div>
                                <a class="theme-btn" href="index.html">Browse Now</a>
                            </div>
                        </div>
                    </div>
                </div>
                {this.photos()}
            </div>
        )
    }
}
